import s from "./Song.module.scss";

const Song = ({ data }) => {
  return (
    <>
    <div>{data.album.cover}</div>
    <div className={s.songInfo}>
        <div>{data.title}</div>
        <div>{data.artist.name}</div>
    </div>
    </>
  );
};
export default Song;
